public static class MyViewHolder extends RecyclerView.ViewHolder{

TextView tv_name;
TextView tv_price;
ImageView img;
LinearLayout item_product;

public MyViewHolder(View itemView) {
super(itemView);

tv_name = (TextView) itemView.findViewById(R.id.product_name);
tv_price = (TextView) itemView.findViewById(R.id.product_price);
img = (ImageView) itemView.findViewById(R.id.product_img);
item_product = (LinearLayout) itemView.findViewById(R.id.product_item_id);
}
}
}

